import React, { useState, useEffect } from "react";
import fetchApplications from "../application/applicationList";

function MonitorPage() {
    const [applications, setApplications] = useState([]);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const data = await fetchApplications(); // Call the utility function to fetch data
                setApplications(data);
            } catch (error) {
                // Handle error if needed
            }
        };

        fetchData(); // Call the fetchData function when the component is mounted
    }, []);
    return (
        <div>
            <h1>Monitor Page</h1>
            {applications.map((application) => (
                <div key={application.id}>
                    <h3>
                        {application.name}&nbsp;
                        {application.title}
                    </h3>
                    <p>{application.firstname}</p>
                    <p>{application.lastname}</p>
                    <p>{application.email}</p>
                    <p>{application.title}</p>
                </div>
            ))}
        </div>
    );
}

export default MonitorPage;
